export class BankService {
  static getBalance = async (userId: number, page: number, startAt?: Date, endAt?: Date) => {
    const response = await fetch('http://localhost:5000/fivem/users/balance', {
      method: 'POST',
      headers: {'Content-Type': 'application/json'},
      body: JSON.stringify({
        Id: userId,
        CurrentPage: page,
        StartAt: startAt,
        EndAt: endAt
      })
    });
    const result = await response.json();

    console.log(result);

    return result;
  }
}
